import React, { useState } from 'react'

interface Props {
    text: string
}

const TestCompornent:React.FC<Props> = (props) => {
    const [count, setCount] = useState(0);
    setCount(1);
    return (
        <div>
            <h1>
                {props.text}
            </h1>
            <h1>
                {count}
            </h1>
        </div>
    )
}

export default TestCompornent
